func (s *CashFlowStatementSmartContract) queryCashFlowStatement(APIstub shim.ChaincodeStubInterface, args []string) sc.Response {

	if len(args) != 1 {
		return shim.Error("Incorrect number of arguments. Expecting 1")
	}

	statementAsBytes, _ := APIstub.GetState(args[0])
	return shim.Success(statementAsBytes)

}

func (s *CashFlowStatementSmartContract) createCashFlowStatement(APIstub shim.ChaincodeStubInterface, args []string) sc.Response {

	if len(args) != 12 {
		return shim.Error("Incorrect number of arguments. Expecting 12")
	}

	var statement = CashFlowStatement{
		OutputActivityBusiness:   args[1],
		InputActivityBusiness:    args[2],
		OutputActivityInvestment: args[3],
		InputActivityInvestment:  args[4],
		OutputActivityFinancial:  args[5],
		InputActivityFinancial:   args[6],
		ProofImage:               args[7],
		CreateAt:                 args[8],
		LastCreateAt:             args[9],
		Quarter:				  args[10],
		Year:					  args[11],
	}

	statementAsBytes, _ := json.Marshal(statement)
	APIstub.PutState(args[0], statementAsBytes)

	return shim.Success(nil)
}

func (s *CashFlowStatementSmartContract) queryAllStatements(APIstub shim.ChaincodeStubInterface) sc.Response {

	query := map[string]interface{}{
		"selector": map[string]interface{}{
			"_id": map[string]interface{}{
				"$regex": "^csstatement:",
			},
		},
	}

	queryBytes, err := json.Marshal(query)
	if err != nil {
		return shim.Error("error marshal")
	}

	//APIstub.GetQueryResult()
	resultsIterator, err := APIstub.GetQueryResult(string(queryBytes))

	if err != nil {
		return shim.Error(err.Error())
	}
	defer resultsIterator.Close()

	// buffer is a JSON array containing QueryResults
	var buffer bytes.Buffer
	buffer.WriteString("[")

	bArrayMemberAlreadyWritten := false
	for resultsIterator.HasNext() {
		queryResponse, err := resultsIterator.Next()
		if err != nil {
			return shim.Error(err.Error())
		}
		// Add a comma before array members, suppress it for the first array member
		if bArrayMemberAlreadyWritten == true {
			buffer.WriteString(",")
		}
		buffer.WriteString("{\"Key\":")
		buffer.WriteString("\"")
		buffer.WriteString(queryResponse.Key)
		buffer.WriteString("\"")

		buffer.WriteString(", \"Record\":")
		// Record is a JSON object, so we write as-is
		buffer.WriteString(string(queryResponse.Value))
		buffer.WriteString("}")
		bArrayMemberAlreadyWritten = true
	}
	buffer.WriteString("]")

	fmt.Printf("- queryAllCashFlowStatements:\n%s\n", buffer.String())

	return shim.Success(buffer.Bytes())

}

